Product details of Marie's Acrylic Colours Set of 24
 &nbsp;


Marie's Acrylic Colours prossess a series of advantages , such as brilliant shade, good dryness and stability, excellent air permeability, good water resistant. Marie&rsquo;s Acrylic Colours are manufactured by our engineers according to artists&rsquo; need and international standard. They are regarded as the excellent products by experts. Marie&rsquo;s Acrylic Colours are new-type drawing colours developed by our company as pioneering domestic products. After being reviewed by certified technician, this product won the prize by the Light Industrial products Department in the field of major scientific and technical achievements. Marie&rsquo;s Acrylic Colours prossess a series of advantage, such as brilliant shade, good dryness and stability, excellent air permeability, strong adhesive power, good water resistance, not easy to fade etc. They can be employed to make painting or handwriting on paper, wood, textiles, cement and bamboo articles. After using, the tools should be washed or dipped into the clean water in order to avoid becoming dry and hard.
